import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Slider from "./DistanceSlider";
import Slider1 from "./RatingsSlider";
import Down from "./CitiesDropdown";
import Price from "./PriceSlider";
import Bdown from "./BloodGroupDropDown";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    marginLeft: "10px",
    marginRight: "10px",
    marginTop: "20px",
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

export default function CenteredGrid(props) {
  const classes = useStyles();

  return (
    <div
      className={classes.root}
      style={{
        padding: "50px",
        borderRadius: "25px",
        backgroundColor: "#F1F1F1",
      }}
    >
      <Grid container spacing={3}>
        <Grid item xs={4}>
          <Slider />
        </Grid>
        <Grid item xs={4}>
          <Slider1 />
        </Grid>
        <Grid item xs={4}>
          <Price />
        </Grid>
        <Grid item xs={4}>
          <Down />
        </Grid>
        <Grid item xs={4}>
          <Bdown />
        </Grid>
      </Grid>
    </div>
  );
}
